import Cover_Frankandoak from './brands/cover-frank-and-oak.jpg';
import Logo_Frankandoak from './brands/logo-frank-and-oak.svg';
import Cover_Zara from './brands/cover-zara.webp';
import Logo_Zara from './brands/logo-zara.png';


let all_brands = [
    {
        id: 1,
        brand: 'Frank and Oak',
        cover: Cover_Frankandoak,
        logo: Logo_Frankandoak,
        about: '',
        color: '#000',
    },
    {
        id: 2,
        brand: 'Zara',
        cover: Cover_Zara,
        logo: Logo_Zara,
        about: '',
        color: '#000',
    },
];

export default all_brands;
